                                <div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('ramen');}}
                                        className='f3 link dim black underline pa3 pointer'>Ramen</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('food');}}
                                        className='f3 link dim black underline pa3 pointer'>Food</h2>
                                </div>
