                                        className='f3 link dim black underline pa3 pointer'>cafe</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('park');}}
                                        className='f3 link dim black underline pa3 pointer'>park</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('club');}}
                                        className='f3 link dim black underline pa3 pointer'>club</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('bar');}}
                                        className='f3 link dim black underline pa3 pointer'>bar</h2>
                                </div>
                                <div>
                                    <h2 onClick={() => {onRouteChange('infos'); loadCategory('study');}}
                                        className='f3 link dim black underline pa3 pointer'>study</h2>
                                </div>
                                </div>
                            </div>
        </div>
    );
}

export default List;
